    <g id="205" transform="matrix(1,0,0,1,945.15,1756)" ed:width="140.00875" ed:parentid="203" ed:height="25">
        <path fill="none" stroke="#e75083" stroke-width="2" stroke-linejoin="round" d="M6.3,0L133.8,0L140,12.5L133.8,25L6.3,25L0,12.5L6.3,0z"/>

            <tspan style="white-space:pre" x="11" textLength="115" y="16.1">findBiggestDivider</tspan>
        </text>
    </g>
    <g id="211" transform="matrix(1,0,0,1,1120.26,1576)" ed:width="780.24" ed:parentid="205" ed:height="385">
        <path fill="none" stroke="#e75083" stroke-width="2" stroke-linejoin="round" d="M96.3,0L684,0L780.2,192.5L684,385L96.3,385L0,192.5L96.3,0z"/>
        <text class="st7">
            <tspan style="white-space:pre" x="140" textLength="17" y="16.1">/**</tspan>
            <tspan style="white-space:pre" x="140" textLength="238" y="34.1"> * author: B00125142 Violet Concordia</tspan>
            <tspan style="white-space:pre" x="140" textLength="429" y="52.1"> * Brute force approach to find the highest divider without remainder</tspan>
            <tspan style="white-space:pre" x="140" textLength="14" y="70.1"> * </tspan>
            <tspan style="white-space:pre" x="140" textLength="238" y="88.1"> * @param input the number to divide</tspan>
            <tspan style="white-space:pre" x="140" textLength="261" y="106.1"> * @returns the divider without remainder</tspan>
            <tspan style="white-space:pre" x="140" textLength="15" y="124.1"> */</tspan>
            <tspan style="white-space:pre" x="140" textLength="482" y="142.1">export function findBiggestDivider(input: number, max: number = MAX_INT): </tspan>
            <tspan style="white-space:pre" x="140" textLength="49" y="160.1">number</tspan>
            <tspan style="white-space:pre" x="140" textLength="4" y="178.1">{</tspan>
            <tspan style="white-space:pre" x="140" textLength="463" y="196.1">    //Decrement loop `max` until either a no remainder result is found, or it </tspan>
            <tspan style="white-space:pre" x="140" textLength="62" y="214.1">reaches 0.</tspan>
            <tspan style="white-space:pre" x="140" textLength="144" y="232.1">    for(; max > 0; --max)</tspan>
            <tspan style="white-space:pre" x="140" textLength="20" y="250.1">    {</tspan>
            <tspan style="white-space:pre" x="140" textLength="173" y="268.1">        if(input/max % 1 == 0)</tspan>
            <tspan style="white-space:pre" x="140" textLength="84" y="286.1">            break;</tspan>
            <tspan style="white-space:pre" x="140" textLength="20" y="304.1">    }</tspan>
            <tspan style="white-space:pre" x="140" textLength="480" y="322.1">    //Return max, which is hopefully the highest number without a remainder. </tspan>
            <tspan style="white-space:pre" x="140" textLength="172" y="340.1">(Worst case scenario, it is 0)</tspan>
            <tspan style="white-space:pre" x="140" textLength="86" y="358.1">    return max;</tspan>
            <tspan style="white-space:pre" x="140" textLength="4" y="376.1">}</tspan>
        </text>
    </g>
    <g id="213" transform="matrix(1,0,0,1,945.15,2237.5)" ed:width="146.024375" ed:parentid="203" ed:height="25">
        <path fill="none" stroke="#e75083" stroke-width="2" stroke-linejoin="round" d="M6.3,0L139.8,0L146,12.5L139.8,25L6.3,25L0,12.5L6.3,0z"/>
        <text class="st7">
            <tspan style="white-space:pre" x="11" textLength="121" y="16.1">findBiggestDividers</tspan>
        </text>
    </g>
    <g id="215" transform="matrix(1,0,0,1,1126.27,1985.5)" ed:width="883.9200000000001" ed:parentid="213" ed:height="529">
        <path fill="none" stroke="#e75083" stroke-width="2" stroke-linejoin="round" d="M132.3,0L751.7,0L883.9,264.5L751.7,529L132.3,529L0,264.5L132.3,0z"/>
        <text class="st7">
            <tspan style="white-space:pre" x="192" textLength="17" y="16.1">/**</tspan>
            <tspan style="white-space:pre" x="192" textLength="238" y="34.1"> * author: B00125142 Violet Concordia</tspan>
            <tspan style="white-space:pre" x="192" textLength="460" y="52.1"> * Appends every highest no remainder divider to an array, until the input </tspan>
            <tspan style="white-space:pre" x="192" textLength="209" y="70.1">number is below the `max` value. </tspan>
            <tspan style="white-space:pre" x="192" textLength="14" y="88.1"> * </tspan>
            <tspan style="white-space:pre" x="192" textLength="244" y="106.1"> * @param input The number to divide.</tspan>
            <tspan style="white-space:pre" x="192" textLength="188" y="124.1"> * @returns The dividers array.</tspan>
            <tspan style="white-space:pre" x="192" textLength="15" y="142.1"> */</tspan>
            <tspan style="white-space:pre" x="192" textLength="488" y="160.1">export function findBiggestDividers(input: number, max: number = MAX_INT): </tspan>
            <tspan style="white-space:pre" x="192" textLength="57" y="178.1">number[]</tspan>
            <tspan style="white-space:pre" x="192" textLength="4" y="196.1">{</tspan>
            <tspan style="white-space:pre" x="192" textLength="215" y="214.1">    //Init array that will be returned.</tspan>
            <tspan style="white-space:pre" x="192" textLength="131" y="232.1">    const dividers = [];</tspan>
            <tspan style="white-space:pre" x="192" textLength="270" y="250.1">    //While input is higher than max number</tspan>
            <tspan style="white-space:pre" x="192" textLength="142" y="268.1">    while(input >= max)</tspan>
            <tspan style="white-space:pre" x="192" textLength="20" y="286.1">    {</tspan>
            <tspan style="white-space:pre" x="192" textLength="256" y="304.1">        //Find biggest no remainder divider.</tspan>
            <tspan style="white-space:pre" x="192" textLength="369" y="322.1">        const biggestDivider = findBiggestDivider(input, max);</tspan>
            <tspan style="white-space:pre" x="192" textLength="177" y="340.1">        //Push the found value.</tspan>
            <tspan style="white-space:pre" x="192" textLength="216" y="358.1">        dividers.push(biggestDivider);</tspan>
            <tspan style="white-space:pre" x="192" textLength="476" y="376.1">        // console.log(`${input} / ${biggestDivider} = ${input / biggestDivider}`);</tspan>
            <tspan style="white-space:pre" x="192" textLength="181" y="394.1">        //Divide by found value.</tspan>
            <tspan style="white-space:pre" x="192" textLength="220" y="412.1">        input = input / biggestDivider;</tspan>
            <tspan style="white-space:pre" x="192" textLength="20" y="430.1">    }</tspan>
            <tspan style="white-space:pre" x="192" textLength="244" y="448.1">    //Push the remainder to result in a 1.</tspan>
            <tspan style="white-space:pre" x="192" textLength="142" y="466.1">    dividers.push(input);</tspan>
            <tspan style="white-space:pre" x="192" textLength="148" y="484.1">    //Return the dividers.</tspan>
            <tspan style="white-space:pre" x="192" textLength="109" y="502.1">    return dividers;</tspan>
            <tspan style="white-space:pre" x="192" textLength="4" y="520.1">}</tspan>
        </text>
    </g>
    <g id="217" transform="matrix(1,0,0,1,825.04,1382.5)" ed:width="86.83687499999999" ed:parentid="197" ed:height="25">

    <g id="219" transform="matrix(1,0,0,1,946.98,1247.5)" ed:width="570.8150000000001" ed:parentid="217" ed:height="295">
        <path fill="none" stroke="#e75083" stroke-width="2" stroke-linejoin="round" d="M73.8,0L497.1,0L570.8,147.5L497.1,295L73.8,295L0,147.5L73.8,0z"/>
        <text class="st7">
            <tspan style="white-space:pre" x="108" textLength="137" y="16.1">export const BITS = 8;</tspan>
            <tspan style="white-space:pre" x="108" textLength="273" y="34.1">export const MAX_INT = Math.pow(2, BITS);</tspan>
            <tspan style="white-space:pre" x="108" textLength="147" y="70.1">export const K = 1_000;</tspan>
            <tspan style="white-space:pre" x="108" textLength="169" y="88.1">export const KK = 1_000*K;</tspan>
            <tspan style="white-space:pre" x="108" textLength="173" y="106.1">export const FREQ = 33*KK;</tspan>
            <tspan style="white-space:pre" x="108" textLength="200" y="124.1">export const TOGGLE_FREQ = 2;</tspan>
            <tspan style="white-space:pre" x="108" textLength="252" y="142.1">export const TOGGLE_CYCLES = 2*FREQ;</tspan>
            <tspan style="white-space:pre" x="108" textLength="208" y="178.1">export const DUTY_CYCLE = 0.75;</tspan>
            <tspan style="white-space:pre" x="108" textLength="349" y="214.1">export const ON_TIME_S = TOGGLE_FREQ*DUTY_CYCLE;</tspan>
            <tspan style="white-space:pre" x="108" textLength="286" y="232.1">export const ON_CYCLES = ON_TIME_S*FREQ;</tspan>
            <tspan style="white-space:pre" x="108" textLength="351" y="268.1">export const OFF_TIME_S = TOGGLE_FREQ - ON_TIME_S;</tspan>
            <tspan style="white-space:pre" x="108" textLength="292" y="286.1">export const OFF_CYCLES = OFF_TIME_S*FREQ;</tspan>
        </text>
    </g>
    <g id="221" transform="matrix(1,0,0,1,825.04,3126.81)" ed:width="69.21187499999999" ed:parentid="197" ed:height="25">

        <text class="st7">
            <tspan style="white-space:pre" x="17" textLength="452" y="16.1">If we want to loop for a single second, we would need to count up to 33 </tspan>

        <text class="st7">
            <tspan style="white-space:pre" x="17" textLength="489" y="16.1">To circumvent this, nested loops will be utilised, which essentially provide us a </tspan>

        </text>
    </g>

        </text>
